import axios from 'axios';
import React, { useEffect, useState } from 'react'

const Api = () => {
    const [data,setData] = useState([]);
    useEffect(() =>{
        try{
            axios.get("https://dummyjson.com/users").then((response)=>{
                console.log(response);
                
            })
        }
        catch(error){
            console.log(error);
            
        }
    },[])
  return (
    <>
    <table>
        <thead>
            <tr>
            <th>Id</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Maiden Name</th>
            <th>Age</th>
            </tr>
        </thead>
        <tbody>
            {data.map((item,index)=>(
                <tr key={index}>
                    <td>{firstName}</td>
                    <td>{lastName}</td>
                    <td>{maidenName}</td>
                    <td>{age}</td>
                </tr>
            ))}
        </tbody>
    </table>
    </>
  )
}

export default Api
